import back from "@/components/Botton/back.vue";
import { apiGetClubMemLog } from "@/api/Club.js";
export default {
  components: {
    back: back
  },
  data: function data() {
    return {
      categoryIndex: 0,
      top10List: [{
        UImg: "",
        UName: "",
        BetSumNum: 0,
        Contribution: 0
      }],
      allList: [{
        UImg: "",
        UName: "",
        BetSumNum: 0,
        Contribution: 0
      }],
      // v-infinite-scroll 套件
      busy: false,
      immediate: false,
      indexNum: 1,
      totalPages: 0
    };
  },
  created: function created() {
    this.getlist();
  },
  methods: {
    // 獲取會員俱樂部資訊
    getlist: function getlist() {
      var _this = this;

      var data = {
        index: this.indexNum,
        count: 10
      };
      apiGetClubMemLog(data, true).then(function (res) {
        _this.top10List = res.Top5Data;
        _this.allList = res.Data.Data;
        _this.totalPages = res.Data.TotalPages;
      });
    },
    // 所有成員無限加載
    load: function load() {
      var _this2 = this;

      console.log('dasd');

      if (this.indexNum >= this.totalPages) {
        this.busy = true;
        return;
      }

      this.indexNum++;
      var data = {
        index: this.indexNum,
        count: 10
      };
      apiGetClubMemLog(data, true).then(function (res) {
        res.Data.Data.forEach(function (el) {
          _this2.allList.push(el);
        });
      });
    }
  }
};
